import React, { useState } from "react";
import usersData from "./usersData";

const Users = () => {
  const [selectedUser, setSelectedUser] = useState(null);

  const users = usersData.map((userData, index) => {
    return { ...userData, id: index + 1 };
  });

  const infoUsers = (user) => {
    setSelectedUser(user);
  };

  return (
    <div>
      <button id="ButtonUsers" onClick={() => infoUsers(users[0])}>
        USERS
      </button>
      {selectedUser && (
        <div className="Card">
          <ul>
            <li>{selectedUser.name}</li>
            <li>{selectedUser.age}</li>
            <li>{selectedUser.email}</li>
          </ul>
        </div>
      )}
    </div>
  );
};

export default Users;
